import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Home.css';

const Home = () => {
    return (
        <div className="container-fluid">
            <div className="row">
                {/* Sol Reklam Alanı (2 grid) */}
                <div className="col-md-2 col-sm-12 advertisement">
                    <h4>Reklam Alanı 1</h4>
                </div>

                {/* Para Birimleri ve Register (8 grid) */}
                <div className="col-md-8 col-sm-12">
                    <div className="row">
                        {/* Para birimi kutuları (6 adet 1 grid) */}
                        <div className="col-md-1 col-sm-6">
                            <div className="currency-box">Para Birimi 1</div>
                        </div>
                        <div className="col-md-1 col-sm-6">
                            <div className="currency-box">Para Birimi 2</div>
                        </div>
                        <div className="col-md-1 col-sm-6">
                            <div className="currency-box">Para Birimi 3</div>
                        </div>
                        <div className="col-md-2 col-sm-6">
                            <div className="currency-box">Para Birimi 4</div>
                        </div>
                        <div className="col-md-2 col-sm-6">
                            <div className="currency-box">Para Birimi 5</div>
                        </div>
                        <div className="col-md-2 col-sm-6">
                            <div className="currency-box">Para Birimi 6</div>
                        </div>

                        {/* Register Alanı (2 grid) */}
                        <div className="col-md-3 col-sm-12">
                            <div className="register-box">Register</div>
                        </div>
                    </div>

                    {/* Para grafiği (2 grid altında) */}
                    <div className="chart-section">
                        <h4>Para Birimi Grafiği</h4>
                        {/* Grafik bileşeni buraya gelecek */}
                    </div>
                </div>

                {/* Sağ Reklam Alanı (2 grid) */}
                <div className="col-md-2 col-sm-12 advertisement">
                    <h4>Reklam Alanı 2</h4>
                </div>
            </div>
        </div>
    );
};

export default Home;
